class Queue(object):    def __init__(self):        self.queue = []    def enqueue(self, item):        self.queue.append(item)    def dequeue(self):        if len(self.queue) < 1:            return None        return self.queue.pop(0)    def list_of_queue(self):        for _item in self.queue:            print(_item)    def size(self):        return len(self.queue)_queue = Queue()_queue.enqueue("first")_queue.enqueue("second")_queue.enqueue("third")_queue.enqueue("fourth")_queue.enqueue("five")_queue.list_of_queue()print(_queue.size())_queue.dequeue()print(_queue.size())_queue.list_of_queue()